    <div class="middle-box text-center loginscreen animated fadeInDown">
        <div id="login-logo">
            <!-- <h1 class="logo-name">SB</h1> -->
            <img src="assets/images/xerkit_logo.png" alt="XerkitInnovations">
        </div>
        <h3>Welcome to Xerkit Partner Portal!</h3>
        <p>"We Make Things Smarter"
        </p>
        <form class="m-t" role="form" action="#">
            <div class="form-group">
                <input name="email" [(ngModel)]='email' type="text" class="form-control" placeholder="Email" required="">
            </div>
            <div class="form-group">
                <input name="password" [(ngModel)]='password' type="password" class="form-control" placeholder="Password" required="">
            </div>
            <button *ngIf="!isLoggingIn" [disabled]="!isValidForm()" (click)="login()" class="btn btn-warning block full-width m-b">Login</button>
            <div *ngIf="isLoggingIn" class="sk-spinner sk-spinner-three-bounce">
                <div class="sk-bounce1"></div>
                <div class="sk-bounce2"></div>
                <div class="sk-bounce3"></div>
            </div>

        </form>
        <p class="m-t">
            <small>Xerkit Technologies &copy; 2017</small>

    </div>
